import React from 'react'

const ServiceAdmin = () => {

    const [head, setHead] = React.useState<string>("")
    const [desc, setDesc] = React.useState<string>("")
    const [headDesc, setHeadDesc] = React.useState<string>("")
    const [descSingle, setDescSingle] = React.useState<string>("")
  return (
    <div className='adminService'>
    <h1 className="content__head quest-form__content-head content__head__headOne">
        AddService</h1>
        <form action="" method="post" onChange={(e)=> setHead(e.target.value)} style={{alignItems: "flex-start", gap:"20px"}}>
            <input className="input" value={head} type="text" name="name" id="name" placeholder="Head"/>
            <textarea className="input" value={desc} name="desc" id="desc"  placeholder="Desc"></textarea>
            <textarea className="input" value={headDesc} name="desc" id="desc"  placeholder="HeadDesc"></textarea>
            <input className="input" value={descSingle} type="text" name="name" id="name" placeholder="descSingle"/>
        <button className="button about-form__botton button__default" >
            Add Now
        </button>
    </form>

    </div>
  )
}

export default ServiceAdmin
